import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor(){
    super();

    this.state = {
      monsters: [
        {
          name: 'Linda',
          id: 'jgjg1'
        },
        {
          name: 'Frank',
          id: 'jgjg2'
        },
        {
          name: 'James',
          id: 'jgjg3'
        }
      ]
    };
  }

  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map((monster) => {
            return (
              <div key={monster.id}>{monster.name}</div>);
          })
        }
      </div>
    );
  }

}

export default App;

